import React from "react";

const PlayDataTabBar = (props) => {
    const handleDetailsClick = () => {
        props.updatePlayData("details");
    }

    const handleCharactersClick = () => {
        props.updatePlayData("characters");
    }

    const handleTextClick = () => {
        props.updatePlayData("text");
    }

    return (
        <div className="container">
            <button onClick={handleDetailsClick}>Details</button>
            <button onClick={handleCharactersClick}>Characters</button>
            <button onClick={handleTextClick}>Text</button>
        </div>
    );
};

export default PlayDataTabBar
